return {version={tree=1,engine=1},variables={},lists={},constants={},tree={mission_start={_={"I continue listening to the voice mesmerised, as the sounds continues shifting, crackling, fading in and out. After a while, I realize tha there is a pattern in the noise. I set the ships computer to track the pattern. Yes, there is information in there!",{var="ship_message",value="\"Anomalous coordinates identified\""},"\"WARNING: Coordinates extracted from anomalous signal!\"",{choice="Set course to anomalous coordinates?",sticky=true,node={{divert="towards_the_signal"}},text=""}}},found_freighter={_={{var="interact_with",value="\"Bondary Failure\""},"This is the source of the anomalous transmission. There is a message waiting for me.",{choice="Download the data",sticky=true,node={{divert="interact_with_beacon"}},text=""},{choice="Leave",sticky=true,node={{divert="towards_the_signal"}},text=""}}},mission_pickup={_={{var="event_type",value="\"incoming_comm_message\""},"The incoming signal is unlike anything you have ever seen before. Carrier frequency oscilates, modulation makes no sense. Ship is struggly to keep tracking the signal, as it is shifting across the spectrum.","With some difficulty, the communicator tunes in. There is silence at first. Then, very faint, I can hear distorted words being spoken.","I can hear the urgency in the voice, and who, or whatever, is trying to communicate with me clearly has a lot to say.","No matter how carefully, I listen, I just can not make out the words.",{choice="Continue listening",sticky=true,node={{divert="mission_start"}},text=""},{choice="Close the connection",sticky=true,node={{divert="dont_start_mission"}},text=""}}},towards_the_signal={_={{var="set_destination",value="\"Nearest Boundary Failure\""},{divert="DONE"}}},build_interface={_={{var="is_community_mission_interface_present",value="true"},{divert="mission_end"}}},_={_={{var="title",value="\"Words between worlds\""},{var="subtitle",value="\"The subtitle of the mission\